  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Federal Interagency Traumatic Brain
  Injury Research (FITBIR) informatics system is an extensible, scalable informatics
  platform for TBI relevant imaging, assessment, genomics, and other data types. It
  was developed to share data across the entire TBI research field and to facilitate
  collaboration between laboratories, as well as interconnectivity with other informatics
  platforms.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
